import React from 'react';
import { Container, Nav } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const DeliveryInfo = () => {
    return (
        <Container fluid>
            <Container>
                <div className="row p-5">
                    <div className="col-md-8 p-5" style={{borderRadius: 20}}>
                        <img src="https://www.jquery-az.com/wp-content/uploads/2016/08/95.0_1-jquery-map.jpg" alt="" className="w-100 rounded"/>
                    </div>
                    <div className="col-md-4 p-5 rounded" style={{borderRadius: 20}}>
                        <div></div>
                    </div>
                </div>
                   
            </Container>
        </Container>
    );
};

export default DeliveryInfo;
